import {StyleSheet} from 'react-native'
const style = StyleSheet.create({
    navbar:{
        flex:1
    },
    image:{
        flex:1,
        resizeMode:'contain',
        justifyContent:'center',
        alignItems:'center'
    },
    tocador:{
        width:'50%',
        height:800,
        backgroundColor:'#E3E1E1',
        borderRadius:20,
        alignItems:'center'
    },
    title:{
        fontSize:40,
        fontWeight:'bold',
        color:'#3E6097',
        paddingTop:40,
        flexDirection:'row'
    },
    imageplayer:{
        width:'30%',
        height:300,
        alignItems:'center',
        resizeMode:'contain',
        paddingTop:20,
    },
    musicname:{
        fontSize:30,
        fontWeight:'bold',
        color:'#374754',
    },
    buttons:{
        flexDirection:'row',
        alignItems:'center'
    },
    playerbuttons:{
        width: 70,
        height:70
    },
    playerbuttonsmini:{
        width: 50,
        height:50
    },
    scroll:{
        width:'20%',
        height:300
    }
});

export default style
